import "node_modules/@openzeppelin/contracts-upgradeable/access/OwnableUpgradeable.sol";
import "node_modules/@openzeppelin/contracts-upgradeable/security/PausableUpgradeable.sol";
import "node_modules/@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "node_modules/@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "node_modules/@openzeppelin/contracts-upgradeable/security/ReentrancyGuardUpgradeable.sol";
import {IWETH} from "./interfaces/IWETH.sol";

interface IRafflePolygon {
    enum RaffleState {
        IN_PROGRESS,
        FINISHED,
        COMPLETED,
        REFUNDED,
        CLAIMED
    }
    function getRaffleState(uint256 _raffleId) external view returns(RaffleState);
    function isCurrencyWhitelisted(address _erc20Token) external view returns(bool);
}

contract RaffleTicketSystem is Initializable, OwnableUpgradeable, PausableUpgradeable, ReentrancyGuardUpgradeable {
    using SafeERC20 for IERC20;

    struct Order {
        address owner;
        address currency;
        uint128 price;
    }

    // RafflePolygon contract
    IRafflePolygon public rafflePolygon;

    // raffleID => ticketId => ticketOwner
    mapping(uint256 => mapping(uint256 => address)) public raffleTickets;
    // raffleId => ticketId => Order
    mapping(uint256 => mapping(uint256 => Order)) public ticketOrders;

    // We can use IWETH interface as the contracts are identical
    IWETH private constant WMATIC = IWETH(0x0d500B1d8E8eF31E21C99d1Db9A6444d3ADf1270); // WMATIC address in Polygon

    // 2,5% Fee
    uint256 public FEE_NUMERATOR;
    uint256 public FEE_DENOMINATOR;

    /**
        Token address => Amount that owners of the contract can claim as fee rewards
        address(0) = Matic
     */
    mapping(address => uint256) public totalAmountClaimable;

    // The name of this contract
    string public constant name = "RaffleTicketSystem";
    string public constant version = "1";
    // The EIP-712 typehash for the contract's domain
    bytes32 private constant DOMAIN_TYPEHASH = keccak256("EIP712Domain(string name,string version,uint256 chainId,address verifyingContract)");
    // The EIP-712 typehash for the ballot struct used by the contract
    bytes32 private constant BALLOT_TYPEHASH = keccak256("Ballot(address buyer,uint256 raffleId,uint256 ticketId,address currency,uint128 price,uint256 nonce)");
    mapping (address => uint256) public nonce;

    // NOTE: Reserved for future upgrades
    uint256[20] private __gap;

    event TicketSellOrderCreated(address seller, 
        uint256 raffleId, 
        uint256 ticketId, 
        address currency, 
        uint128 price
    );
    event TicketSellOrderCancelled(
        address seller, 
        uint256 raffleId, 
        uint256 ticketId, 
        address currency, 
        uint128 price
    );
    event TicketBoughtFromMarket(
        address buyer, 
        address seller, 
        uint256 raffleId, 
        uint256 ticketId, 
        address currency, 
        uint128 price
    );
    event TicketBoughtFromMarketWithSignature(
        address buyer, 
        address seller, 
        uint256 raffleId, 
        uint256 ticketId, 
        address currency, 
        uint128 price
    );
    event RaffleContractUpdated(address oldRaffleContract, address newRaffleContract);
    event ProtocolFeeUpdated(uint256 oldFee, uint256 newFee);

    function initialize(address _rafflePolygon) public initializer {
        __Ownable_init();
        __Pausable_init();
        __ReentrancyGuard_init();

        rafflePolygon = IRafflePolygon(_rafflePolygon);

        FEE_NUMERATOR = 250;
        FEE_DENOMINATOR = 10000;
    }

    modifier onlyRaffleContract {
        require(msg.sender == address(rafflePolygon), "OnlyRaffleContract");
        _;
    }

    /**
     * @notice  Called by the RaffleContract to "mint/burn" raffle tickets
     */
    function assignTicketToUser(address user, uint256 _raffleId, uint256 initTicketId, uint256 endTicketId) external onlyRaffleContract {
        for (uint256 i = initTicketId; i <= endTicketId; ++i){
            raffleTickets[_raffleId][initTicketId] = user;
        }
    }

    /** ############################################################################################
     *              TICKET MARKETPLACE FUNCTIONS
     *  ############################################################################################
     */

    /**
     * @notice  Allows users to put their raffle tickets for sale
     * @param   _raffleId raffleID
     * @param   _ticketId ticketID
     * @param   _currency Tickets will be bought with this ERC20 token. address(0) should be put here if the currency will be Matic
     * @param   _price Price per ticket. It can be zero in case of an "airdrop"
     */
    function postSellOrder(uint256 _raffleId, uint256 _ticketId, address _currency, uint128 _price) external whenNotPaused {
        require(msg.sender == raffleTickets[_raffleId][_ticketId], "You do not own this ticket");
        require(rafflePolygon.isCurrencyWhitelisted(_currency), "Currency is not whitelisted");
        require(rafflePolygon.getRaffleState(_raffleId) == IRafflePolygon.RaffleState.IN_PROGRESS, "Raffle state must be IN_PROGRESS");

        Order storage orderData = ticketOrders[_raffleId][_ticketId];
        orderData.owner = msg.sender;
        orderData.currency = _currency;
        orderData.price = _price;
        emit TicketSellOrderCreated(msg.sender, _raffleId, _ticketId, _currency, _price);
    }

    /**
     * @notice  Allows Order owners to cancel a current sell order
     * @param   _raffleId raffleID
     * @param   _ticketId ticketID
     */
    function cancelSellOrder(uint256 _raffleId, uint256 _ticketId) external whenNotPaused {
        Order memory orderData = ticketOrders[_raffleId][_ticketId];
        require(orderData.owner == msg.sender, "You do not own this order");

        delete ticketOrders[_raffleId][_ticketId];
        emit TicketSellOrderCancelled(msg.sender, _raffleId, _ticketId, orderData.currency, orderData.price);
    }

    /**
     * @notice  Allows users to buy a raffle ticket
     * @param   _raffleId raffleID
     * @param   _ticketId ticketID
     * @param   _buyer Address which the ticket will be assigned to
     * @param   _currency Currency used as payment
     * @param   _price Price
     * Note: Last 2 parameters are used to prevent sellers of frontrunning the postBuyOrder() call setting a new price/currency
     */
    function postBuyOrder(uint256 _raffleId, uint256 _ticketId, address _buyer, address _currency, uint256 _price) external payable nonReentrant whenNotPaused {
        Order memory orderData = ticketOrders[_raffleId][_ticketId];
        require(orderData.owner != address(0), "This order does not exist");
        require(orderData.owner == raffleTickets[_raffleId][_ticketId], "Ticket has a new owner");
        require(rafflePolygon.isCurrencyWhitelisted(orderData.currency), "Currency is not whitelisted");
        require(rafflePolygon.getRaffleState(_raffleId) == IRafflePolygon.RaffleState.IN_PROGRESS, "Raffle state must be IN_PROGRESS");
        // Prevent frontrunning
        require(orderData.currency == _currency, "Currency was changed");
        require(orderData.price == _price, "Price was changed");

        uint256 fee = (orderData.price * FEE_NUMERATOR) / FEE_DENOMINATOR;
        uint256 payment = orderData.price - fee;
        // Payment in Matic
        if(orderData.currency == address(0)){
            require(msg.value == orderData.price, "Matic payment too low");
            _handleNativeTransfer(orderData.owner, payment);
            totalAmountClaimable[address(0)] += fee;
        }
        else{
            IERC20(orderData.currency).safeTransferFrom(msg.sender, address(this), fee);
            IERC20(orderData.currency).safeTransferFrom(msg.sender, orderData.owner, payment);
            totalAmountClaimable[orderData.currency] += fee;
        }

        delete ticketOrders[_raffleId][_ticketId];
        raffleTickets[_raffleId][_ticketId] = _buyer;

        emit TicketBoughtFromMarket(_buyer, orderData.owner, _raffleId, _ticketId, orderData.currency, orderData.price);
    }

    /**
     * @notice  Allows users to buy a raffle ticket with a valid signature of the current NFT owner
     * @param   _raffleId rafleId
     * @param   _ticketId ticketId
     * @param   _currency ERC20 used as payment
     * @param   _price Price
     * @param   _buyer Address which the ticket will be assigned to
     * @param   _r Signature R
     * @param   _s Signature S
     * @param   _v Signature V
     */
    function buyTicketWithSignature(uint256 _raffleId, uint256 _ticketId, address _currency, uint128 _price, address _buyer, bytes32 _r, bytes32 _s, uint8 _v) external payable nonReentrant whenNotPaused {
        address seller = raffleTickets[_raffleId][_ticketId];
        require(seller != address(0), "This ticket does not exist");
        require(rafflePolygon.isCurrencyWhitelisted(_currency), "Currency is not whitelisted");
        require(rafflePolygon.getRaffleState(_raffleId) == IRafflePolygon.RaffleState.IN_PROGRESS, "Raffle state must be IN_PROGRESS");

        // Used to prevent stack too deep error
        {
            bytes32 domainSeparator = keccak256(abi.encode(DOMAIN_TYPEHASH, keccak256(bytes(name)), keccak256(bytes(version)), block.chainid, address(this)));
            bytes32 structHash = keccak256(abi.encode(BALLOT_TYPEHASH, msg.sender, _raffleId, _ticketId, _currency, _price, nonce[seller]));
            bytes32 digest = keccak256(abi.encodePacked("\x19\x01", domainSeparator, structHash));
            address signer = ecrecover(digest, _v, _r, _s);
            require(signer == seller, "Invalid signature");
        }
        nonce[seller] += 1;

        uint256 fee = (_price * FEE_NUMERATOR) / FEE_DENOMINATOR;
        uint256 payment = _price - fee;
        // Payment in Matic
        if(_currency == address(0)){
            require(msg.value == _price, "Matic payment too low");
            _handleNativeTransfer(seller, payment);
            totalAmountClaimable[address(0)] += fee;
        }
        else{
            IERC20(_currency).safeTransferFrom(msg.sender, address(this), fee);
            IERC20(_currency).safeTransferFrom(msg.sender, seller, payment);
            totalAmountClaimable[_currency] += fee;
        }

        raffleTickets[_raffleId][_ticketId] = _buyer;
        delete ticketOrders[_raffleId][_ticketId];
        emit TicketBoughtFromMarketWithSignature(_buyer, seller, _raffleId, _ticketId, _currency, _price);
    }

    /** ############################################################################################
     *              INTERNAL/PRIVATE FUNCTIONS
     *  ############################################################################################
     */

    /**
     *  Function to handle native transfers
     */
    function _handleNativeTransfer(address _dest, uint256 _amount) internal {
        // Handle MATIC payment
        require(address(this).balance >= _amount, "_handleNativeTransfer insolvent");
        uint256 gas =  gasleft();
        (bool success, ) = _dest.call{value: _amount, gas: gas}("");
        // If the MATIC transfer fails, wrap the MATIC and try to send it as WMATIC.
        if (!success) {
            WMATIC.deposit{value: _amount}();
            IERC20(address(WMATIC)).safeTransfer(_dest, _amount);
        }
    }

    /** ############################################################################################
     *              ONLYOWNER FUNCTIONS
     *  ############################################################################################
     */

    /**
     * @notice  Used to pause/unpause the smart contract by the owner
     */
    function togglePause() external onlyOwner {
        if (!paused()) _pause();
        else _unpause();
    }

    /**
     * @notice  Used to set a new RafflePolygon contract
     */
    function setNewRaffleContract(address _newRaffleContract) external onlyOwner {
        emit RaffleContractUpdated(address(rafflePolygon), _newRaffleContract);
        rafflePolygon = IRafflePolygon(_newRaffleContract);
    }

    /**
     * @notice  Used to set the FEE_NUMERATOR by the owner
     */
    function setProtocolFee(uint256 _newFeeNumerator) external onlyOwner {
        require(_newFeeNumerator < 10000, "Fee must be <= 100 %");
        emit ProtocolFeeUpdated(FEE_NUMERATOR, _newFeeNumerator);
        FEE_NUMERATOR = _newFeeNumerator;
    }

    /**
     * @notice  Used by the contract owners to claim the fees accrued
     * @param   _tokenAddress List of tokens to withdraw the fees
     * @param   _amounts List of amounts that will be withdrawn
     * @param   _receiver Address that will receive the fees
     */
    function withdrawFees(address[] calldata _tokenAddress, uint256[] calldata _amounts, address _receiver) external onlyOwner {
        uint256 len = _tokenAddress.length;
        require(len == _amounts.length, "Array lengths do not match");
        uint256 amount;
        address tokenAddress;
        for (uint256 i; i < len; ++i) {
            tokenAddress = _tokenAddress[i];
            amount = _amounts[i];
            require(amount <= totalAmountClaimable[tokenAddress], "Amount too high");
            if(tokenAddress == address(0)){
                _handleNativeTransfer(_receiver, amount);
            }
            else{
                IERC20(tokenAddress).safeTransfer(_receiver, amount);
            }
            // No overflow here as => require(amount <= totalAmountClaimable[tokenAddress])
            unchecked {
                totalAmountClaimable[tokenAddress] -= amount;
            }
        }
    }

    /** ############################################################################################
     *                 VIEW FUNCTIONS
     *  ############################################################################################
     */

    function getTicketOwner(uint256 _raffleId, uint256 _ticketId) external view returns(address) {
        address owner = raffleTickets[_raffleId][_ticketId];
        require(owner != address(0), "Ticket has no owner");
        return owner;
    }
}
